import React from 'react';

import "./pool2.css";

import { Button, Row } from "react-bootstrap";

function ldrDai() {
    return (
      <div className="ldr_dai">
        <div className="wrapper">
          <div className="ldr">
            <Row className="row_css">
            </Row>
          </div>
          <div className="mt-4">
            <Button className="pool1-btn-custom " variant="primary">
              SELLECT
            </Button>
          </div>
        </div>
      </div>
    );
}
export default ldrDai
